import React from 'react';
import './paymentcard.css';
import image20 from '../../images/20.png'
import image21 from '../../images/21.png'

const Buynow = ({ name, email, amount, debitCardNumber, expiryDate, cvv }) => {
  return (
    <div className="payment-card">
      <div className="card-header">
        <div className="card-name">{name}</div>
        <div className="card-email">{email}</div>
      </div>
      <div className="card-body">
        <div className="card-amount"><p>Amount: {amount}</p>
        <img src={image20} height={20} width={80}/><img src={image21}/>
        </div>

        <div className="card-number">Debit Card Number: {debitCardNumber}</div>
        <div className="card-expiry">Expiry Date: {expiryDate}</div>
        <div className="card-cvv">CVV: {cvv}</div>
      </div>
    </div>
  );
};

export default Buynow;
